	add("cascabel", "{\"term\":\"cascabel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027cascabel\u0027 (bell, rattle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small, round, hot variety of chili pepper, \u0027Capsicum annuum\u0027, which rattles when dry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027 [1984], Jean Andrews, \u0027Peppers: The Domesticated Capsicums\u0027, [http://books.google.com.au/books?id\u003dSsjvX31EMekC\u0026amp;pg\u003dPA100\u0026amp;dq\u003d%22cascabel%22%7C%22cascabels%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbgkJUZ3LB8OKlQXJ_oG4Dw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cascabel%22%7C%22cascabels%22\u0026amp;f\u003dfalse page 100\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The very pungent Mexican \u0027\u0027Cascabel\u0027\u0027 looks a lot like the Cherry pepper when it is growing.In the dry state the skin becomes translucent and the seeds are loose so that they rattle, hence \u0027cascabel\u0027, which means sleigh or jingle bells. Another cultivar, the elongate Catarina, is often called \u0027\u0027Cascabel\u0027\u0027 because its dry seeds also make a noise within its translucent dry skin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Didi Emmons, \u0027Vegetarian Planet: 350 Big-Flavor Recipes for Out-Of-This-World Food Every Day\u0027, [http://books.google.com.au/books?id\u003dUzINyuVUDz4C\u0026amp;pg\u003dPT428\u0026amp;dq\u003d%22cascabel%22%7C%22cascabels%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsxQJUeb6KsSpkwWUyICYBg\u0026amp;redir_esc\u003dy page 415\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Cascabels\u0027\u0027 are available dried in Latin American markets. Hot and nutty in flavor, \u0027\u0027cascabels\u0027\u0027 are good in sauces, beans, and chilis\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Rick Greenspan, Hal Kahn, \u0027The Leave-No-Crumbs Camping Cookbook\u0027, [http://books.google.com.au/books?id\u003dwCMJAygwg3EC\u0026amp;pg\u003dPA94\u0026amp;dq\u003d%22cascabel%22%7C%22cascabels%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbgkJUZ3LB8OKlQXJ_oG4Dw\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cascabel%22%7C%22cascabels%22\u0026amp;f\u003dfalse page 94\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Prepare the \u0027\u0027cascabels\u0027\u0027 using one of the methods in the Preparing \u0027\u0027Cascabels\u0027\u0027 box, at left\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A knob at the end of a cannon, cast onto the gun barrel, to which ropes are attached in order to control recoil\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1862\u0027\u0027, Samuel Kneeland, George Bliss, David Ames Wells, William Ripley Nichols, Charles Robert Cross (editor), John Trowbridge (editor), \u0027Year-Book of Facts in Science and Art\u0027, [http://books.google.com.au/books?id\u003d5LkWAQAAIAAJ\u0026amp;pg\u003dPA91\u0026amp;dq\u003d%22cascabel%22%7C%22cascabels%22+cannon\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dchYJUbrqNMfkkgXt54DoAg\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cascabel%22%7C%22cascabels%22%20cannon\u0026amp;f\u003dfalse page 91\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027cascabel\u0027\u0027, instead of being permanently attached to the breech of the piece, is set into it by means of a screw, and thus in reality the bore extends the entire distance of the gun, so that when the \u0027\u0027cascabel\u0027\u0027 is taken off one can look directly through the gun\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Roy F Sullivan, \u0027The Texas Revolution: Tejano Heroes\u0027, [http://books.google.com.au/books?id\u003deMNAvRo8aVQC\u0026amp;pg\u003dPA137\u0026amp;dq\u003d%22cascabel%22%7C%22cascabels%22+cannon\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dchYJUbrqNMfkkgXt54DoAg\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cascabel%22%7C%22cascabels%22%20cannon\u0026amp;f\u003dfalse page 137\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"This iron cannon with a single muzzle band, without trunnions and with an oversized \u0027\u0027cascabel\u0027\u0027 is believed by many to be the original ‚ÄúCome and Take It‚Äù cannon and is displayed at the Gonzales Memorial Museum and occasionally elsewhere within Texas\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Chris Messner, \u0027Cuba Open from the Inside: Travels in the Forbidden Land\u0027, [http://books.google.com.au/books?id\u003dFZBMX5w27xgC\u0026amp;pg\u003dPT119\u0026amp;dq\u003d%22cascabel%22%7C%22cascabels%22+cannon\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dchYJUbrqNMfkkgXt54DoAg\u0026amp;redir_esc\u003dy unnumbered page\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"I was looking at a 151 mm caliber cannon, which used the twentyfour pound cannon ball and displayed a beautiful lion‚Ä≤s head on the back end of its breach area. An elaborate \u0027\u0027cascabel\u0027\u0027 stuck out of the mouth of each animal. The \u0027\u0027cascabel\u0027\u0027 was primarily used to attach ropes that secured the cannon during the recoil blowback that came from firing\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A bell attached to a sleigh or sleigh harness\", \"priority\":19}]}, \"synonyms\":{}}");

