	add("cashew", "{\"term\":\"cashew\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Portuguese\"], \"text\":\"French \u0027acajou\u0027 from Portuguese \u0027acaj√∫\u0027 from \u0027\u0027 () or \u0027\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tree, \u0027Anacardium occidentale\u0027, native to northeastern Brazil, now widely grown in tropical climates for its cashew nuts and cashew apples\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, P. K. Ray, \u0027Breeding Tropical and Subtropical Fruits\u0027, [http://books.google.com.au/books?id\u003d0l2JnsONxlAC\u0026amp;pg\u003dPA221\u0026amp;dq\u003d%22cashew%22%7C%22cashews%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dSvzxUq7XA4e0kgX304DACw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cashew%22%7C%22cashews%22\u0026amp;f\u003dfalse page 221\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Soft-wood grafting and veneer grafting are successful in \u0027\u0027cashew\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Roger Martin, \u0027Tree-Kangaroos of Australia and New Guinea\u0027, [http://books.google.com.au/books?id\u003dA4SUo1QTn-sC\u0026amp;pg\u003dPA106\u0026amp;dq\u003d%22cashew%22%7C%22cashews%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKSLyUom8GsaXkgWU3IDYAQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cashew%22%7C%22cashews%22\u0026amp;f\u003dfalse page 106\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Also known as the Native \u0027\u0027Cashew\u0027\u0027, it is a member of the Anacardiaceae, the same plant family to which the \u0027\u0027Cashew\u0027\u0027 and Mango trees belong\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Alice Kurian, K. V. Peter (series editor), \u0027Commercial Crops Technology\u0027, Volume 8, Horticulture Science Series, [http://books.google.com.au/books?id\u003d2VFYqwA-Mn4C\u0026amp;pg\u003dPA63\u0026amp;dq\u003d%22cashew%22%7C%22cashews%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dSvzxUq7XA4e0kgX304DACw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cashew%22%7C%22cashews%22\u0026amp;f\u003dfalse page 63\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Cashew\u0027\u0027 (\u0027Anacardium occidental\u0027 L.) is an export-oriented crop grown for its nuts, a true drupe\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A cashew nut\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Thomas Payne, \u002717: Nuts\u0027, Laszlo Somogyi, Diane M. Barrett, Y. H. Hui (editors), \u0027Processing Fruits\u0027, [http://books.google.com.au/books?id\u003dkNQG8AXT6tAC\u0026amp;pg\u003dPA529\u0026amp;dq\u003d%22cashew%22%7C%22cashews%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dSvzxUq7XA4e0kgX304DACw\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cashew%22%7C%22cashews%22\u0026amp;f\u003dfalse page 529\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"In some countries, \u0027\u0027cashews\u0027\u0027 continue to be cracked manually although cracking machinery and other shelling mechanisms have been introduced\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Frederic Rosengarten, Jr., \u0027The Book of Edible Nuts\u0027, [http://books.google.com.au/books?id\u003d7CK8LFCcvtcC\u0026amp;pg\u003dPA46\u0026amp;dq\u003d%22cashew%22%7C%22cashews%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dSvzxUq7XA4e0kgX304DACw\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cashew%22%7C%22cashews%22\u0026amp;f\u003dfalse page 46\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The bland \u0027\u0027cashew\u0027\u0027 is a fitting substitute for higher priced almonds to extend the nut texture. In baking, however, almonds are more suitable for cake decoration than \u0027\u0027cashews\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Dick Logue, \u0027500 Low Glycemic Index Recipes\u0027, [http://books.google.com.au/books?id\u003d7xrYiHe7zqUC\u0026amp;pg\u003dPA413\u0026amp;dq\u003d%22cashew%22%7C%22cashews%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dPh3yUuX8KoqIkwWNhoCQCA\u0026amp;redir_esc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cashew%22%7C%22cashews%22\u0026amp;f\u003dfalse page 413\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"This is a spicy variation of Kung Pao Chicken using \u0027\u0027cashews\u0027\u0027 rather than the more common peanuts\", \"priority\":20}]}, \"synonyms\":{}}");

