	add("cassock", "{\"term\":\"cassock\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027casaque\u0027 (cloak)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A military cloak or long coat worn by soldiers or horsemen in the 16th and 17th centuries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A coarse, loose cloak or gown, worn by women, sailors, shepherds, countryfolk etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An item of clerical clothing: a long, sheath-like, close-fitting, ankle-length robe worn by clergy members of some Christian denominations\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dIt was a joy to snatch some brief respite, and find himself in the rectory drawing‚Äìroom. Listening here was as pleasant as talking; just to watch was pleasant. The young priests who lived here wore \u0027\u0027cassocks\u0027\u0027 and birettas; their faces were fine and mild, yet really strong, like the rector\u0027s face; and in their intercourse with him and his wife they seemed to be brothers\", \"priority\":4}]}, \"synonyms\":{}}");

