	add("castrophile", "{\"term\":\"castrophile\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Castro|phile|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supporter or admirer, especially a foreign one, of w:Fidel Fidel Castro or the Castro regime\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It remains to be seen whether the United States Government holds to these conditions in political crises (especially if there is a danger of a \u0027\u0027Castrophile\u0027\u0027 Government appearing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ed Butler remembers that \u0026quot;he was a total \u0027\u0027Castrophile\u0027\u0027. He wanted to promote Fidel Castro and did everything that he could in the debate, prior to it, and afterward.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"When I started this journey, I was a \u0027\u0027Castrophile\u0027\u0027 with a soft spot for the Revolution\", \"priority\":4}]}, \"synonyms\":{}}");

