	add("casualty", "{\"term\":\"casualty\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|casuƒÅlitas}} (compare \u0027\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Chance nature; randomness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"NYRB 2001, vol.1, p.327-8\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The non-necessary [causes] follow; of which, saith Fuchsius, no art can be made, by reason of their uncertainty, \u0027\u0027casualty\u0027\u0027, and multitude\u0026amp;nbsp;[‚Ä¶\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something that happens by chance, especially an unfortunate event; an accident, a disaster\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person suffering from injuries or who has been killed due to an accident or through an act of violence\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The accident and emergency department of a hospital\", \"priority\":6}]}, \"synonyms\":{}}");

