	add("casuist", "{\"term\":\"casuist\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"French\", \"Latin\"], \"text\":\"From French \u0027casuiste\u0027 from Spanish \u0027casuista\u0027 from Latin \u0027casus\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who resolves cases of conscience or moral duty\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone who attempts to specify exact and precise rules for the direction of every circumstance of behavior\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1759\u0027\u0027, w:Adam Adam Smith, \u0027[http://oll.libertyfund.org/index.php?option\u003dcom_staticxt\u0026amp;staticfile\u003dshow.php%3Ftitle\u003d192\u0026amp;Itemid\u003d28 Theory of Moral Sentiments]\u0027, page 329\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The second set of moralists, among whom we may count all the \u0027\u0027casuists\u0027\u0027 of the middle and latter ages of the christian church, ... endeavor to lay down exact and precise rules for the direction of every circumstance of our behaviour\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One who is skilled in, or given to, casuistry\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The judgment of any \u0027\u0027casuist\u0027\u0027 or learned divine concerning the state of a man\u0027s soul, is not sufficient to give him confidence\", \"priority\":6}]}, \"synonyms\":{}}");

	add("casuistry", "{\"term\":\"casuistry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|casuist|ry|lang\u003den}}. First recorded use in 1725.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of answering practical questions via interpretation of rules, or of cases that illustrate such rules, especially in ethics\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, Sidney Monas (translator), Fyodor Dostoyevsky, \u0027Crime and Punishment\u0027 1866\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And yet it would seem that the whole analysis he had made, his attempt to find a moral solution to the problem, was complete. His \u0027\u0027casuistry\u0027\u0027 had been honed to a razor‚Äôs edge, and he could no longer think of any objections\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Richard Powers, \u0027Galatea 2.2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"‚ÄúAnd if you lose?‚Äù Diana enunciated, through a thin grin. She meant to extract \u0027\u0027casuistry\u0027\u0027‚Äôs penalty in advance\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A specious argument designed to defend an action or feeling\", \"priority\":6}]}, \"synonyms\":{}}");

